// 签到
async function checkIn() {
        return new Promise((resolve, reject) => {
            var a = {
                integral_task_id: 1,
                millis: +new Date()
            }, o = encrypt(JSON.stringify(a));
            let opt = {
                url: 'https://burning.wo-adv.cn/integral/addIntegralTaskList.do',
                headers: {
                    "cookie": cookie,
                    "content-type": "application/json" 
                },
                body: o
            }
            $.post(opt, async (error, resp, data) => {       
            try {
                if (error) {
                  $.log(`${JSON.stringify(error)}`)
                  $.log(`${$.name} API请求失败，请检查网路重试`)
                } else {
                  if (data) {
                    var obj = JSON.parse(data);
                    if (obj.resultCode === 10001) {
                        disCookie = true;
                        if(!$.isNode){
                            $.log(`【账号${$.index}】签到失败：Cookie失效, 已清除\n请重新获取Cookie`);
                            message += `【账号${$.index}】签到失败：Cookie失效, 已清除\n请重新获取Cookie\n`;
                        } else {
                            $.log(`【账号${$.index}】签到失败：Cookie失效\n请重新获取Cookie`);
                            message += `【账号${$.index}】签到失败：Cookie失效\n请重新获取Cookie\n`;
                        }
                        $.setdata('', 'burningCookie');
                        return
                    } else if (obj.resultCode === 0) {
                        $.log(`【账号${$.index}】签到成功`);
                        message  += `【账号${$.index}】签到成功\n`;
                    }  else if (obj.resultCode === 10026) {
                        $.log(`【账号${$.index}】签到失败：重复签到`);
                        message  += `【账号${$.index}】签到失败：重复签到\n`;
                    } else {
                        $.log(`【账号${$.index}】签到失败：未知错误请查看日志或手动签到!!!\n${obj}`);
                        message  += `【账号${$.index}】签到失败：未知错误请查看日志或手动签到!!!\n${obj}`;
                    }
                  } else {
                    console.log(`超燃汇服务器返回空数据`)
                  }
                }
              } catch (e) {
                $.logErr(e, resp)
              } finally {
                resolve();
              }
            }        
        )
    })
}

// 查询所有抽奖活动id
async function getActivityIds(){
    return new Promise((resolve, reject) => {
        var a = {
            millis: +new Date()
        }, o = encrypt(JSON.stringify(a));
        let opt = {
            url: 'https://burning.wo-adv.cn/actvt/queryActivityEntranceList.do',
            headers: {
                "cookie": cookie,
                "content-type": "application/json" 
            },
            body: o
        }
        $.post(opt, async (error, resp, data) => {
                try {
                    if (error) {
                    $.log(`${JSON.stringify(error)}`)
                    $.log(`${$.name} API请求失败，请检查网路重试`)
                    } else {
                    if (safeGet(data)) {
                        var obj = JSON.parse(data);
                        var activityList = obj.resultData;
                        for(let activity of activityList) {
                            let str = activity.ACTIVITY_ENTRANCE_URL;
                            let reg = /activity_id=([^&]*)/;
                            if (str.includes('activity_id')){
                                activityId= str.match(reg)[1];
                                activityIds.push(activityId);
                            }
                        }
                    }
                }
                } catch (e) {
                $.logErr(e, resp)
                } finally {
                resolve(data);
                }   
            }        
        )
    })
}

