function getCookie() {
    if($request && $request.method != `OPTIONS` && $request.url.match(/\/integral\/queryTemlateList\.do/)){
        try {
            const cookie = $request.headers['Cookie'] || $request.headers['cookie'];
            if(burningCookies){
                if(burningCookies.indexOf(cookie) > -1){
                    $.msg($.name, '获取Cookie重复，本次跳过', '不用请自行关闭重写!');
                    return
                } else if(burningCookies.indexOf(cookie) == -1) {
                    burningCookies += "\n" + cookie;
                }
            } else {
                burningCookies = cookie;
            }
                $.setdata(burningCookies, 'burningCookie');
                $.log("获取超燃汇Cookie成功: " + cookie);
                $.msg($.name, '🎉 获取Cookie成功', '不用请自行关闭重写!')
            } catch (err) {
                $.logErr(`获取超燃汇Cookie异常：${err}`);
                $.msg($.name, '❌获取Cookie异常');
            }
        }
    }

async function SendMsg(message) {
    if (!message) return;
    if (Notify > 0) {
        if ($.isNode()) {
            await notify.sendNotify($.name, message)
        } else {
            $.msg($.name, '', message)
        } 
    } else{
        $.msg($.name, '', message)
    }
}

function getRandomInt(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min)) + min;
}

function safeGet(data) {
    try {
      if (typeof JSON.parse(data) == "object") {
        return true;
      }
    } catch (e) {
      console.log(e);
      console.log(`超燃汇服务器访问数据为空，请检查自身设备网络情况`);
      return false;
    }
  }

